import{_ as l,a as o}from"./chunks/pm03d_contents.Ce3Qv86o.js";import{_ as a}from"./chunks/pm02d_pinout.R-AJXYSl.js";import{_ as r,c as t,a8 as e,o as n}from"./chunks/framework.BDnHobkS.js";const b=JSON.parse('{"title":"Модуль живлення Holybro PM03D","description":"","frontmatter":{},"headers":[],"relativePath":"uk/power_module/holybro_pm03d.md","filePath":"uk/power_module/holybro_pm03d.md"}'),s={name:"uk/power_module/holybro_pm03d.md"};function h(p,i,d,m,c,u){return n(),t("div",null,i[0]||(i[0]=[e('<h1 id="модуль-живлення-holybro-pm03d" tabindex="-1">Модуль живлення Holybro PM03D <a class="header-anchor" href="#модуль-живлення-holybro-pm03d" aria-label="Permalink to &quot;Модуль живлення Holybro PM03D&quot;">​</a></h1><p>Плата живлення PM03D виступає як блок живлення (PM) та розподільча плата живлення (PDB). Крім надання регульованого живлення Pixhawk v5X та ESC, вона надсилає інформацію автопілоту про напругу батареї та поточний струм, який подається на керуючий пристрій польоту та двигуни.</p><p>Плата живлення підключається за допомогою протоколу I2C. It is designed for flight controllers based on the Pixhawk FMUv5X and FMUv6X open standard, including the <a href="./../flight_controller/pixhawk5x.html">Pixhawk 5X</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The PM is <strong>NOT</strong> compatible with flight controllers that require an analog power module, including: <a href="./../flight_controller/pixhawk4.html">Pixhawk 4</a>, <a href="./../flight_controller/durandal.html">Durandal</a>, <a href="./../flight_controller/holybro_pix32_v5.html">Pix32 v5</a>, etc.</p></div><p><img src="'+l+'" alt="Pixhawk5x Upright Image"></p><h2 id="функціі" tabindex="-1">Функції <a class="header-anchor" href="#функціі" aria-label="Permalink to &quot;Функції&quot;">​</a></h2><ul><li>Plug &amp; play, no additional setup required for QGroundcontrol &amp; Mission Planner</li><li>Роз&#39;єми XT-30 та паяльні площини для простого підключення моторів та ESC</li><li>Onboard voltage regulators: two 5.2V &amp; one selectable 8V/12V</li><li>Порти 5V/A для живлення супутнього комп&#39;ютера або периферійного пристрою</li><li>На вибір 8V або 12V трирядний рядок контактів для живлення периферійного пристрою</li></ul><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><ul><li><strong>Maximum input voltage</strong>: 6S battery</li><li><strong>Rated current</strong>: 60A</li><li><strong>Max current</strong>: 120A (&lt;60 Sec)</li><li><strong>Max current sensing</strong>: 164A</li><li><strong>Communication protocol</strong>: I2C</li><li><strong>Dimension</strong>: 84 x 78 x 12mm (excluding wires)</li><li><strong>Mounting</strong>: 45 x 45mm</li><li><strong>Weight</strong>: 59g</li><li><strong>Connections</strong>:</li><li>ХТ-60 для акумулятора</li><li>XT-30 for motor &amp; peripheral device (battery voltage)</li><li>Паяльні вклади в кожному кутку (напруга акумулятора)</li><li>CLIK-Mate 2.0мм для контролю за польотами (5.2V/3A standalone BEC)</li><li>JST GH 4pin (5.2V/3A, BEC shared with 5.2V потрійний рядок шпильковий заголовок)</li><li>2x Трьохрядний шплинтовий рядок (5.2V/3A, BEC спільний з JST GH 4pin)</li><li>2x Трьохрядний шплинтовий заголовок (8V або 12V вибирається переміщенням стрижня заголовка, 3A)</li></ul><h2 id="вміст-набору" tabindex="-1">Вміст набору <a class="header-anchor" href="#вміст-набору" aria-label="Permalink to &quot;Вміст набору&quot;">​</a></h2><ul><li>1x Плата PM06</li><li>1x 80 мм кабель з роз&#39;ємом XT60 (попередньо припаяний)</li><li>1x Електролітична ємність: 220uF 63V (передпаяна)</li><li>1x 2.0мм інтервал CLIK-Mate 6pin кабель (Для живлення контролера польоту)</li><li>4pin JST GH в USB тип C</li><li>4pin JST GH до бочкового штекера (2.1*5.5мм)</li><li>4pin JST GH до бочкового штекера (2.5*5.5мм)</li><li>Кабель Дюпон 4-шпильковий (2шт)</li><li>Nylon standoffs &amp; nuts</li></ul><img src="'+o+'" width="650px" title="Pixhawk5x Upright Image"><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><a href="https://holybro.com/products/pm03d-power-module" target="_blank" rel="noreferrer">Order from Holybro Store</a></p><h2 id="проведення-підключення" tabindex="-1">Проведення/Підключення <a class="header-anchor" href="#проведення-підключення" aria-label="Permalink to &quot;Проведення/Підключення&quot;">​</a></h2><p><img src="'+a+'" alt="pinout"></p><p>Additional wiring and connection information can be found in: <a href="./../assembly/quick_start_pixhawk5x.html">Holybro Pixhawk 5x Wiring Quick Start</a>.</p>',17)]))}const _=r(s,[["render",h]]);export{b as __pageData,_ as default};
